Duck typing is a style of dynamic typing in which an object's methods and properties determine the valid semantics, rather than its inheritance from a particular class or interface.

In duck typing, the type of an object is determined by the presence of certain methods and properties, rather than its inheritance from a particular class or interface. 

For example:
```js
function add(x, y) {
  if (typeof x.add === 'function' && typeof y.add === 'function') {
    return x.add(y);
  } 
}

let a = {
  add: function(b) {
    return this.value + b.value;
  },
  value: 1 
};

let b = {
  add: function(a) {
    return a.add(this);
  },
  value: 2
};

add(a, b); // Returns 3
```
Here we are not checking the types of a and b, we are just checking if they have an add method, and if so, we call it. This is duck typing.

In TypeScript, interfaces can be used to provide static typing to duck typed objects. For example:
```ts
interface Addable {
  add(x: Addable): number;
  value: number; 
}

function add(x: Addable, y: Addable) {
  return x.add(y); 
}

let a: Addable = {
  add: function(b: Addable) {
    return this.value + b.value; 
  },
  value: 1
};

let b: Addable = {
  add: function(a: Addable) {
    return a.add(this);
  },
  value: 2 
};

add(a, b); // Returns 3
```

Here we defined an interface `Addable` with an `add` method and `value` property. Then we typed `a` and `b` as `Addable`, giving static typing to our duck typed objects.

